import React from 'react';
import { ThemeProvider } from 'theme-ui'
import theme from '../theme'

const Navigation = () => (
    <Flex justifyContent='space-between'>
        <Box>yo</Box>
    </Flex>
);

const App = () => (
    <ThemeProvider theme={theme}>
        <Navigation />
    </ThemeProvider>
);

export default App;
